import ListAnime from '../Component/ListAnime'

export default function HomePage() {
  return (
    <div className='justify-center flex h-[100vh]'>
        <div className='w-[65vw] justify-center flex bg-black h-full'>
        <ListAnime/>
        </div>
    </div>
  )
}
